          num: "全7レッスン + 3記事",
        },
        {
          name: "jQuery",
          image:
            "https://s3-ap-northeast-1.amazonaws.com/progate/shared/images/lesson/react/html.svg",
          introduction: "Webページの見た目を作る言語",
          num: "全7レッスン + 3記事",
        },
        {
          name: "jQuery",
          image:
            "https://s3-ap-northeast-1.amazonaws.com/progate/shared/images/lesson/react/html.svg",
          introduction: "Webページの見た目を作る言語",
          num: "全7レッスン + 3記事",
        },
      ],
      [
        {
          name: "HTML&CSS",
          image:
            "https://s3-ap-northeast-1.amazonaws.com/progate/shared/images/lesson/react/html.svg",
          introduction: "Webページの見た目を作る言語",
          num: "全7レッスン + 3記事",
        },
        {
          name: "JavaScript",
          image:
            "https://s3-ap-northeast-1.amazonaws.com/progate/shared/images/lesson/react/es6.svg",
          introduction: "Webページの見た目を作る言語",
          num: "全7レッスン + 3記事",
        },
        {
          name: "jQuery",
          image:
            "https://s3-ap-northeast-1.amazonaws.com/progate/shared/images/lesson/react/html.svg",
          introduction: "Webページの見た目を作る言語",
          num: "全7レッスン + 3記事",
        },
        {
          name: "jQuery",
          image:
            "https://s3-ap-northeast-1.amazonaws.com/progate/shared/images/lesson/react/html.svg",
          introduction: "Webページの見た目を作る言語",
          num: "全7レッスン + 3記事",
        },
      ],
    ];

    return (
      <div className="main-wrapper">
        <div className="path-container">
          <p className="title">
            <img src="https://d2aj9sy12tbpym.cloudfront.net/javascripts/dist/assets/path_icon-1edbb8798c7c47abcf29ad3d545d3ae1.svg" />
            パス
          </p>
          <div className="path-main-card">
            <h1>Web開発パス(Node.js)</h1>
            <p>
              このパスではWeb開発に必要な知識を学ぶことができます。
              Node.jsを使ってWebアプリの仕組みを理解し、実際に作れるようになりましょう！
            </p>
          </div>
        </div>

        {/*language-path-list */}
        <div className="language-path-list">
          <div className="path-card">
            <div className="path-item">
              <img src="https://d18en44nkeqroq.cloudfront.net/paths/rails/top-image.svg" />
              <h4>Web開発パス(Ruby on Rails)</h4>
              <p className="path-text">
                <img src="https://d2aj9sy12tbpym.cloudfront.net/javascripts/dist/assets/skill_icon-f7d795a28a48caef1e6040886572bdcd.svg" />
                全3コース
              </p>
            </div>
          </div>
        </div>

        <div className="lesson-container">
          <p className="title">
            <img src="https://d2aj9sy12tbpym.cloudfront.net/javascripts/dist/assets/skill_icon-f7d795a28a48caef1e6040886572bdcd.svg" />
            コース
          </p>
          {/*Lesson1*/}
          {LessonList[0].map((lessonItem) => {
            return (
              <Lesson
                name={lessonItem.name}
                image={lessonItem.image}
                introduction={lessonItem.introduction}
              />
            );
          })}

          {/*Lesson2*/}
          {LessonList[1].map((lessonItem) => {
            return (
              <Lesson
                name={lessonItem.name}
                image={lessonItem.image}
                introduction={lessonItem.introduction}
              />
            );
          })}

          {/*Lesson3*/}
          {LessonList[2].map((lessonItem) => {
            return (
              <Lesson
                name={lessonItem.name}
                image={lessonItem.image}
                introduction={lessonItem.introduction}
              />
            );
          })}
        </div>
      </div>
    );
  }
}
export default Main;
